import { useNavigate } from "react-router-dom";

const StudentDashboard = () => {
  const navigate = useNavigate();

  const modules = [
    { name: "College Exam Prep", desc: "AI summaries, previous year questions, mock tests", path: "/exam-prep" },
    { name: "Placement Prep", desc: "DBMS, OS, CN, DSA, aptitude and core subjects", path: "/placement-prep" },
    { name: "Coding & SQL Practice", desc: "Solve DSA sheets, SQL problems, get AI hints", path: "/coding-practice" },
    { name: "AI Interview Assistant", desc: "Mock interviews with AI feedback and scoring", path: "/ai-interview" },
    { name: "Progress & Analytics", desc: "Track progress, leaderboard, badges", path: "/progress" },
  ];

  return (
    <div className="min-h-screen bg-gray-100 p-10">
      <h1 className="text-3xl font-bold text-green-600 mb-6 text-center">
        Student Dashboard
      </h1>

      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
        {modules.map((module) => (
          <div
            key={module.name}
            onClick={() => navigate(module.path)}
            className="bg-white rounded-2xl p-6 shadow-lg cursor-pointer hover:shadow-2xl hover:scale-105 transition-transform"
          >
            <h2 className="text-xl font-semibold text-green-700 mb-2">
              {module.name}
            </h2>
            <p className="text-gray-600">{module.desc}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default StudentDashboard;
